import ExpenseItem from "./ExpenseItem";
import './Expenses.css';
import ExpensesFilter from "./ExpensesFilter";
import React from "react";

/*Props passed from app.js */
function Expenses(props) {


    return(
    <div className="expenses">


<ExpensesFilter year={props.year} selectedYear={props.selectedYear} filterhandler={props.filterHandler}/>


 {props.filteredList.map((ele) => {   
     return (
        <ExpenseItem key={ele.id} date={ele.date} title={ele.title} amount={ele.amount}/>
        ) }
        )}

        </div>)

}


export default Expenses
